import React from 'react'
import { NavLink } from 'react-router-dom'


export default function SignedIn() {
    return (
        <ul className="right">

            <li><NavLink to="/"><i class="material-icons">collections</i></NavLink></li>
            <li><NavLink to="/"><i class="material-icons">add_a_photo</i></NavLink></li>
            <li><NavLink to="/" class="dropdown-trigger"  data-target="dropdown1"><img style={{width:"40px",height:"40px",borderRadius:"40px",verticalAlign:"middle"}} src="https://avatars2.githubusercontent.com/u/51698550?s=460&u=b2a9911e8c6e6dc7f76328e3a3495a60a043b869&v=4"/><i class="material-icons right">arrow_drop_down</i></NavLink></li>
            <li><a className="dropdown-trigger" href="#!" data-target="dropdown">Dropdown<i className="material-icons right">arrow_drop_down</i></a></li>
        </ul>    
    )
}
